import CategoryPage from "../category/category.component";

const ShopPage = ({}) => {
    const match = useMatch('/shop');
    console.log("useMatch", match.pathname);
   return(<div className="shop-page">
    {/* <CollectionOverview/> */}
   <Routes>
   <Route exact path={`${match.pathname}`} element={<CollectionOverview/>} />
    <Route path={`${match.pathname}/:categoryId`} element={<CategoryPage/>} />
   </Routes>
 </div>)
 }


export default ShopPage;
